import React, { Component } from 'react';
import '../Content.css'
import K from './Map/3.png' //กะทู้
import T from './Map/4.png' //ถลาง
import M from './Map/2.png' //เมือง

class Chart extends Component {
    constructor(props) {
        super(props);

        this.toggle = this.toggle.bind(this);
        this.state = {
            tooltipOpen: false
        };
    }

    toggle() {
        this.setState({
            tooltipOpen: !this.state.tooltipOpen
        });
    }

    render() {
        return (
            <div className="Map">
                <div class="container-fluid" >
                    <div class="row" >
                        <div class="col-lg-4" >
                            <img src={K} width="55%" />
                        </div>

                        <div class="col-lg-4" >
                            <img src={T} width="100%" />
                        </div>

                        <div class="col-lg-4" >
                            <img src={M} width="50%" />
                        </div>

                    </div>
                </div>
            </div>
        )
    }
}
export default Chart
